import React from "react";
import "./navbar.css";
import { useSelector } from "react-redux";

export default function Navbar() {
  const userName = localStorage.getItem("username");
  const isAuthenticated = useSelector((store) => store.auth.isAuthenticated);
  console.log("username", userName);
  console.log("isauth", isAuthenticated);

  return (
    <nav className="navContainer">
      <div className="left-nav">
        <a href="/home">Photo</a>
        <a href="/search/category1/empty">category1</a>
        <a href="/search/category2/empty">category2</a>
        <a href="/search/category3/empty">category3</a>
        <a href="/search/category4/empty">category4</a>
        <a href="/search/category5/empty">category5</a>
      </div>
      <div className="right-nav">
        <a href="/post">Post Item</a>
        <div className={`dropdown ${isAuthenticated ? "show" : "hide"}`}>
          <a href="#" className="dropdown-toggle">
            {userName}
          </a>
          <div className="dropdown-menu">
            <div>
              <a className="dropdown-item" href="#">
                Profile
              </a>
            </div>

            <div>
              <a className="dropdown-item" href="#">
                Settings
              </a>
            </div>

            <div>
              {" "}
              <a className="dropdown-item" href="#">
                Logout
              </a>
            </div>
          </div>
        </div>
        <a href={isAuthenticated ? "#" : "/signup"} className="signup-link">
          {isAuthenticated ? "" : "SignUp"}
        </a>
      </div>
    </nav>
  );
}
